NUMBER_OF_INSERTIONS = 150

for i in range(1,NUMBER_OF_INSERTIONS):
    valor = random.random()
    multiplier = [10000,100000,1000000]
    random.shuffle(multiplier)
    valor = round(valor*multiplier[0],2)

    dia = random.randint(1,30)
    mes = random.randint(1,12)
    ano = random.randint(2017,2019)
    hora = random.randint(0,23)
    minuto = random.randint(1,59)
    segundo = random.randint(1,59)
    data = "{}-{:02d}-{:02d} {:02d}:{:02d}:{:02d}".format(ano, mes, dia, hora, minuto, segundo)

    moeda = ['R$', 'US$']
    random.shuffle(moeda)
    moeda = moeda[0]

    id_conta = [i for i in range(1,5)]
    random.shuffle(id_conta)
    id_conta = id_conta[0]

    query = "insert into api_transacoes(valor,dataTransacao,simbolo_moeda,idConta_id) values({},'{}','{}',{});".format(valor, data, moeda, id_conta)

    print(query)
    
